#include <sys/ioctl.h>
#include <stdio.h>
#include <unistd.h>

#define ROWS 42
#define COLS 100
#define FRAMES 27

char* n[FRAMES][ROWS];
void initFrames(void);

int main(int argc, char* argv[]) {
    initFrames();
    struct winsize w;
    ioctl(STDOUT_FILENO, TIOCGWINSZ, &w);
    int cols = w.ws_col;
    int offset = 0;
    int width = COLS;
    while (width > cols) {
        offset++;
        width -= 2;
    }
        

    int frame = 0;
    while (1) {
        for(int i=0; i<42; i++) {
            for(int j=offset; j<offset+width; j++)
                printf("%c", n[frame][i][j]);
            printf("\n");
        }
        usleep(100*1000);
        printf("\e[1;1H\e[2J");

        frame = (++frame) % 27;
    }
    
}

